import React from 'react';
import './SideDrawer.css';

const sideDrawer = props => {
    let drawerClasses = ['side-drawer']
    if(props.show) {
        drawerClasses = 'side-drawer open'
    }

    

    return (
        <nav className={drawerClasses}>
            <div className="company-name">
                KralCo
            </div>
            <ul>
                <li><button onClick={props.click}>Send Coins</button></li>
                <li><button onClick={props.click}>Receive Coins</button></li>
                <li><button onClick={props.click}>Change Wallet</button></li>
                <li><button onClick={props.click}>Change Network</button></li>
            </ul>
        </nav>
    )
};

export default sideDrawer;
